import React from 'react';
import CodeCard from './CodeCard';
import './CodeNav.css';


function CodeNav({codes }) {
    console.log(codes);
    return (
        <div className="code-card-list">
          {codes.map((code, index) => (
            <CodeCard
              key={index} 
              title={code.name}
              code={code.currCodes}
            />
          ))}
        </div>
      );
}

export default CodeNav
